elements\":[{\"id\":\"b97f8ca\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"802baa5\",\"elType\":\"widget\",\"settings\":{\"eael_show_dch_icon_content\":\"\",\"eael_dch_first_title\":\"ABOUT \",\"eael_dch_last_title\":\"The office\",\"eael_dch_subtext\":\"\",\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"-30\",\"left\":\"0\",\"isLinked\":false},\"eael_dch_base_title_color\":\"#7C5E5E\",\"eael_dch_dual_title_color\":\"#30291D\"},\"elements\":[],\"widgetType\":\"eael-dual-color-header\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"0c98266\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"497c078\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"4dd67c9\",\"elType\":\"widget\",\"settings\":{\"align\":\"justify\",\"editor\":\"<p>In a mockumentary design, it shows Michael Scott (Steve Carell), regional manager of the Scranton branch office, as he attempts to persuade the movie producers of the narrative that he directs a cheerful, well-running office. Then, agent Jim Halpert (John Krasinski) discovers strategies to sabotage his solid shape mate, Dwight Schrute (Rainn Wilson); assistant Pam Beesly (Jenna Fischer) is attempting to manage Michael\'s inhumanities and flubs; and the impermanent representative Ryan Howard (B. J. Novak) is acting generally as an eyewitness of the madness around him. Considering that most of those episodes clocked in around 22 minutes apiece, that means that it would take you roughly 4,422 minutes to watch the entire series. Some of you may not have time in your busy schedules to accomplish such a demanding task (though I would argue it\'s well worth the effort).<\\/p>\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_weight\":\"500\",\"__globals__\":{\"text_color\":\"globals\\/colors?id=secondary\",\"typography_typography\":\"globals\\/typography?id=accent\"}},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"2730383\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Set in Scranton, Pennsylvania, in the sales office of a nearly obsolete paper company, the show\'s characters at first didn\'t develop as much as stagnate. Like their dead-end jobs and the dead-end lives that inevitably spring from such jobs, these people were just passing time, one prolonged meeting at a time. Just as reality television soothes a viewer\'s inner narcissist by telling stories of even more pronounced narcissists wreaking havoc on their surroundings, The Office made its audience feel better about their professional lives by showcasing a workplace with even drabber d\\u00e9cor and more grating coworkers.<\\/p>\",\"__globals__\":{\"text_color\":\"globals\\/colors?id=secondary\",\"typography_typography\":\"globals\\/typography?id=accent\"}},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"7b54cf7\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Based on the award-winning British comedy of the same name, this acclaimed sitcom is told through the lenses of a documentary film crew and filled with gossip, pranks, romance and general foolishness at Dunder-Mifflin Paper Co. in Scranton, Pennsylvania. If you\'ve ever hated your boss, your job or both, then you\'ll love this show.<\\/p>\",\"__globals__\":{\"text_color\":\"globals\\/colors?id=secondary\",\"typography_typography\":\"globals\\/typography?id=accent\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"4940921\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"fd80adf\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/assignment\\/wp-content\\/uploads\\/2021\\/03\\/about.jpg\",\"id\":185}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false}]'),(429,87,'_wp_page_template','elementor_header_f