 Howard (B. J. Novak) is acting generally as an eyewitness of the madness around him. Considering that most of those episodes clocked in around 22 minutes apiece, that means that it would take you roughly 4,422 minutes to watch the entire series. Some of you may not have time in your busy schedules to accomplish such a demanding task (though I would argue it\'s well worth the effort).\\u00a0<\\/p><p><span style=\\\"color: #202124; font-family: Roboto, arial, sans-serif; font-size: 13px; text-align: left; white-space: pre-wrap;\\\">\\u00a0<\\/span><\\/p>\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_weight\":\"500\",\"__globals__\":{\"text_color\":\"globals\\/colors?id=secondary\",\"typography_typography\":\"globals\\/typography?id=accent\"}},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"2730383\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Set in Scranton, Pennsylvania, in the sales office of a nearly obsolete paper company, the show\'s characters at first didn\'t develop as much as stagnate. Like their dead-end jobs and the dead-end lives that inevitably spring from such jobs, these people were just passing time, one prolonged meeting at a time. Just as reality television soothes a viewer\'s inner narcissist by telling stories of even more pronounced narcissists wreaking havoc on their surroundings, The Office made its audience feel better about their professional lives by showcasing a workplace with even drabber d\\u00e9cor and more grating coworkers.<\\/p>\",\"__globals__\":{\"text_color\":\"globals\\/colors?id=secondary\",\"typography_typography\":\"globals\\/typography?id=accent\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"4940921\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"fd80adf\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/assignment\\/wp-content\\/uploads\\