INSERT INTO `__wp_assignmentposts` VALUES (1,1,'2021-03-26 17:23:47','2021-03-26 17:23:47','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','trash','open','open','','hello-world__trashed','','','2021-03-27 08:57:54','2021-03-27 08:57:54','',0,'http://localhost/assignment/?p=1',0,'post','',1),(2,1,'2021-03-26 17:23:47','2021-03-26 17:23:47','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/assignment/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','trash','closed','open','','sample-page__trashed','','','2021-03-26 18:06:37','2021-03-26 18:06:37','',0,'http://localhost/assignment/?page_id=2',0,'page','',0),(3,1,'2021-03-26 17:23:47','2021-03-26 17:23:47','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost/assignment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2021-03-26 17:23:47','2021-03-26 17:23:47','',0,'http://localhost/assignment/?page_id=3',0,'page','',0),(4,1,'2021-03-26 17:25:18','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2021-03-26 17:25:18','0000-00-00 00:00:00','',0,'http://localhost/assignment/?p=4',0,'post','',0),(6,1,'2021-03-26 17:52:16','2021-03-26 17:52:16','','Default Kit','','publish','closed','closed','','default-kit','','','2021-03-26 17:52:16','2021-03-26 17:52:16','',0,'http://localhost/assignment/?elementor_library=default-kit',0,'elementor_library','',0),(7,1,'2021-03-26 17:57:11','2021-03-26 17:57:11','[smartslider3 slider=\"3\"]\n                <h1>THE OFFICE  shOW</h1>\n		<p>The Office is an American TV sitcom broadcast on NBC. It is a documentary that follows the everyday existences of the workers of the Scranton, Pennsylvania part of Dunder Mifflin, an anecdotal paper supply company. A total of 201 episodes of The Office aired over nine seasons.</p>https://www.youtube.com/watch?v=0GXjAMnv1zs		\n							\"That\'s What She Said\"\n							<img width=\"147\" height=\"150\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/michael-scott-michael-scott-steve-carell-115629433348awbpe6n7a.png\" alt=\"\" loading=\"lazy\" />						\n														Micheal Scott\n																						Regional Manager','Home','','publish','closed','closed','','home','','','2021-03-27 07:15:47','2021-03-27 07:15:47','',0,'http://localhost/assignment/?page_id=7',0,'page','',0),(8,1,'2021-03-26 17:57:11','2021-03-26 17:57:11','','Home','','inherit','closed','closed','','7-revision-v1','','','2021-03-26 17:57:11','2021-03-26 17:57:11','',7,'http://localhost/assignment/?p=8',0,'revision','',0),(9,1,'2021-03-26 17:57:44','2021-03-26 17:57:44','<h2>ABOUT  The office</h2>\n		<p>In a mockumentary design, it shows Michael Scott (Steve Carell), regional manager of the Scranton branch office, as he attempts to persuade the movie producers of the narrative that he directs a cheerful, well-running office. Then, agent Jim Halpert (John Krasinski) discovers strategies to sabotage his solid shape mate, Dwight Schrute (Rainn Wilson); assistant Pam Beesly (Jenna Fischer) is attempting to manage Michael\'s inhumanities and flubs; and the impermanent representative Ryan Howard (B. J. Novak) is acting generally as an eyewitness of the madness around him. Considering that most of those episodes clocked in around 22 minutes apiece, that means that it would take you roughly 4,422 minutes to watch the entire series. Some of you may not have time in your busy schedules to accomplish such a demanding task (though I would argue it\'s well worth the effort).</p><p>Set in Scranton, Pennsylvania, in the sales office of a nearly obsolete paper company, the show\'s characters at first didn\'t develop as much as stagnate. Like their dead-end jobs and the dead-end lives that inevitably spring from such jobs, these people were just passing time, one prolonged meeting at a time. Just as reality television soothes a viewer\'s inner narcissist by telling stories of even more pronounced narcissists wreaking havoc on their surroundings, The Office made its audience feel better about their professional lives by showcasing a workplace with even drabber décor and more grating coworkers.</p><p>Based on the award-winning British comedy of the same name, this acclaimed sitcom is told through the lenses of a documentary film crew and filled with gossip, pranks, romance and general foolishness at Dunder-Mifflin Paper Co. in Scranton, Pennsylvania. If you\'ve ever hated your boss, your job or both, then you\'ll love this show.</p>		\n										<img width=\"640\" height=\"961\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/about.jpg\" alt=\"\" loading=\"lazy\" />','About','','publish','closed','closed','','about','','','2021-03-27 07:35:27','2021-03-27 07:35:27','',0,'http://localhost/assignment/?page_id=9',0,'page','',0),(10,1,'2021-03-26 17:57:44','2021-03-26 17:57:44','','About','','inherit','closed','closed','','9-revision-v1','','','2021-03-26 17:57:44','2021-03-26 17:57:44','',9,'http://localhost/assignment/?p=10',0,'revision','',0),(11,1,'2021-03-26 17:58:00','2021-03-26 17:58:00','<figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"29794cc\" data-elementor-lightbox-title=\"Character_-_MichaelScott.PNG\" href=\'http://localhost/assignment/wp-content/uploads/2021/03/Character_-_MichaelScott.PNG-1.png\'><img width=\"181\" height=\"300\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/Character_-_MichaelScott.PNG-1.png\" alt=\"\" loading=\"lazy\" aria-describedby=\"gallery-3-212\" /