/office-copy-1.jpg\'><img width=\"640\" height=\"360\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/office-copy-1.jpg\" alt=\"\" loading=\"lazy\" aria-describedby=\"gallery-1-47\" /></a>\n				<figcaption class=\'wp-caption-text gallery-caption\' id=\'gallery-1-47\'>\n				Maichel\n				</figcaption></figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"29794cc\" data-elementor-lightbox-title=\"the-office-u.S..jpg.824x0_q71_crop-scale\" href=\'http://localhost/assignment/wp-content/uploads/2021/03/the-office-u.S..jpg.824x0_q71_crop-scale.jpg\'><img width=\"640\" height=\"360\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/the-office-u.S..jpg.824x0_q71_crop-scale.jpg\" alt=\"\" loading=\"lazy\" aria-describedby=\"gallery-1-46\" /></a>\n				<figcaption class=\'wp-caption-text gallery-caption\' id=\'gallery-1-46\'>\n				Pam\n				</figcaption></figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"29794cc\" data-elementor-lightbox-title=\"The Office\" href=\'http://localhost/assignment/wp-content/uploads/2021/03/The-Office-1.jpg\'><img width=\"640\" height=\"427\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/The-Office-1.jpg\" alt=\"\" loading=\"lazy\" aria-describedby=\"gallery-1-45\" /></a>\n				<figcaption class=\'wp-caption-text gallery-caption\' id=\'gallery-1-45\'>\n				Ryan\n				</figcaption></figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"29794cc\" data-elementor-lightbox-title=\"2086266-333034145\" href=\'http://localhost/assignment/wp-content/uploads/2021/03/2086266-333034145.jpg\'><img width=\"640\" height=\"360\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/2086266-333034145.jpg\" alt=\"\" loading=\"lazy\" aria-describedby=\"gallery-1-43\" /></a>\n				<figcaption class=\'wp-caption-text gallery-caption\' id=\'gallery-1-43\'>\n				Stanley\n				</figcaption></figure>','Services','','inherit','closed','closed','','11-revision-v1','','','2021-03-26 21:31:59','2021-03-26 21:31:59','',11,'http://localhost/assignment/?p=91',0,'revision','',0),(92,1,'2021-03-26 21:38:06','2021-03-26 21:38:06','<img width=\"250\" height=\"358\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/1.jpg\" alt=\"\" loading=\"lazy\" />											\n			<h3>A documentary crew begins filming the Scranton employees of Dunder Mifflin Paper Company, observing everything from awkward workplace etiquette (spearheaded by Regional Manager, Michael Scott) to hilarious office pranks between sales reps Jim Halpert and Dwight Schrute; none of the footage includes any actual work getting done.</h3>		\n			<h3>Inter-office relationships develop between Angela and Dwight, Michael and Jan, and Kelly and Ryan, while Jim and Pam\'s \"will-they, won\'t they\" storyline hits a roadblock, prompting Jim to transfer to the Stamford branch and break our collective hearts.</h3>		\n										<img width=\"640\" height=\"914\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/2.jpg\" alt=\"\" loading=\"lazy\" />											\n										<img width=\"482\" height=\"686\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/3.jpg\" alt=\"\" loading=\"lazy\" />											\n			<h3>The Stamford and Scranton branches merge together, introducing new characters (Karen and Andy) and reuniting a now-single Pam with a not-so-single Jim (though they eventually get their act together and finally start dating); meanwhile, Jan gets fired and is replaced at Corporate by Ryan, proving that even fictional white men come out on top.</h3>		\n			<h3>Jan and Michael break up, Ryan gets arrested for fraud, Toby moves to Costa Rica and is replaced by Holly Flax, Dwight mercy-kills Angela\'s sick cat, causing her to dump him and get engaged to Andy soon thereafter (though she and Dwight continue to sleep together); oh, and Pam decides to take a graphic design course in New York City to purse her dreams as an artist.</h3>		\n										<img width=\"271\" height=\"370\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/4.jpg\" alt=\"\" loading=\"lazy\" />											\n										<img width=\"270\" height=\"370\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/5.jpg\" alt=\"\" loading=\"lazy\" />											\n			<h3>Michael and Holly fall in love, but break up due to long distance, Michael briefly resigns from Dunder Mifflin to start his own paper company, Andy — upon learning about Angela and Dwight\'s affair — calls off the wedding, and a newly engaged Jim and Pam find out they\'re expecting.</h3>		\n			<h3>Dunder Mifflin goes bankrupt and gets bought by a printer company, while Jim and Pam get married (twice) and welcome the birth of their daughter, Cecelia Marie Halpert.</h3>		\n										<img width=\"250\" height=\"349\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/6.jpg\" alt=\"\" loading=\"lazy\" />											\n										<img width=\"271\" height=\"368\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/7.jpg\" alt=\"\" loading=\"lazy\" />											\n			<h3>Holly and Michael get engaged and then promptly move away to Colorado due to Steve Carell\'s departure from the series, but not before his colleagues perform a heart-wrenching Rent parody to say goodbye.</h3>		\n			<h3>Dwight fulfills his lifelong dream of becoming Regional Manager; one year after the documentary is released, everyone reunites —including Michael — for Dwight and Angela\'s wedding, proving that this series was always about way more than just a paper company.</h3>		\n										<img width=\"250\" height=\"327\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/8.jpg\" alt=\"\" loading=\"lazy\" />											\n										<img width=\"250\" height=\"323\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/9.jpg\" alt=\"\" loading=\"lazy\" />											\n			<h3>Andy replaces Michael as regional manager; Pam and Angela both give birth to baby boys named Phillip, though the paternity of Angela\'s baby is up for debate (spoiler alert: Dwight\'s totally the father).</h3>','Seasons','','publish','closed','closed','','seasons','','','2021-03-27 08:50:03','2021-03-27 08:50:03','',0,'http://localhost/assignment/?page_id=92',0,'page','',0),(93,1,'2021-03-26 21:38:06','2021-03-26 21:38:06','','Seasons','','inherit','closed','closed','','92-revision-v1','','','2021-03-26 21:38:06','2021-03-26 21:38:06','',92,'http://localhost/assignment/?p=93',0,'revision','',0),(94,1,'2021-03-26 21:43:31','2021-03-26 21:43:31','','Seasons','','inherit','closed','closed','','92-revision-v1','','','2021-03-26 21:43:31','2021-03-26 21:43:31','',92,'http://localhost/assignment/?p=94',0,'revision','',0),(95,1,'2021-03-26 21:43:31','2021-03-26 21:43:31','','Seasons','','inherit','closed','closed','','92-revision-v1','','','2021-03-26 21:43:31','2021-03-26 21:43:31','',92,'http://localhost/assignment/?p=95',0,'revision','',0),(96,1,'2021-03-26 21:43:31','2021-03-26 21:43:31','<figure><img src=\"http://localhost/assignment/wp-content/uploads/2021/03/thumb-1920-153352.jpg\" alt=\"Season 1\" /><figcaption>Season 1</figcaption></figure><figure><img src=\"http://localhost/assignment/wp-content/uploads/2021/03/Dwight_Schrute.jpg\" alt=\"Season 1\" /><figcaption>Season 1</figcaption></figure><figure><img src=\"http://localhost/assignment/wp-content/uploads/2021/03/The-Office-1.jpg\" alt=\"Season 1\" /><figcaption>Season 1</figcaption></figure><figure><img src=\"http://localhost/assignment/wp-content/uploads/2021/03/the-office-u.S..jpg.824x0_q71_crop-scale.jpg\" alt=\"Season 1\" /><figcaption>Season 1</figcaption></figure><figure><img src=\"http://localhost/assignment/wp-content/uploads/2021/03/office-copy.jpg\" alt=\"Season 1\" /><figcaption>Season 1</figcaption></figure><figure><img src=\"http://localhost/assignment/wp-content/uploads/2021/03/208