0,'revision','',0),(188,1,'2021-03-27 07:24:27','2021-03-27 07:24:27','<h2>ABOUT  The office</h2>\n		<p>In a mockumentary design, it shows Michael Scott (Steve Carell), regional manager of the Scranton branch office, as he attempts to persuade the movie producers of the narrative that he directs a cheerful, well-running office. Then, agent Jim Halpert (John Krasinski) discovers strategies to sabotage his solid shape mate, Dwight Schrute (Rainn Wilson); assistant Pam Beesly (Jenna Fischer) is attempting to manage Michael\'s inhumanities and flubs; and the impermanent representative Ryan Howard (B. J. Novak) is acting generally as an eyewitness of the madness around him.</p>		\n										<img width=\"640\" height=\"961\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/about.jpg\" alt=\"\" loading=\"lazy\" />','About','','inherit','closed','closed','','9-revision-v1','','','2021-03-27 07:24:27','2021-03-27 07:24:27','',9,'http://localhost/assignment/?p=188',0,'revision','',0),(189,1,'2021-03-27 07:31:05','2021-03-27 07:31:05','<h2>ABOUT  The office</h2>\n		<p>In a mockumentary design, it shows Michael Scott (Steve Carell), regional manager of the Scranton branch office, as he attempts to persuade the movie producers of the narrative that he directs a cheerful, well-running office. Then, agent Jim Halpert (John Krasinski) discovers strategies to sabotage his solid shape mate, Dwight Schrute (Rainn Wilson); assistant Pam Beesly (Jenna Fischer) is attempting to manage Michael\'s inhumanities and flubs; and the impermanent representative Ryan Howard (B. J. Novak) is acting generally as an eyewitness of the madness around him.</p>		\n										<img width=\"640\" height=\"961\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/about.jpg\" alt=\"\" loading=\"lazy\" />','About','','inherit','closed','closed','','9-revision-v1','','','2021-03-27 07:31:05','2021-03-27 07:31:05','',9,'http://localhost/assignment/?p=189',0,'revision','',0),(190,1,'2021-03-2