rly obsolete paper company, the show\'s characters at first didn\'t develop as much as stagnate. Like their dead-end jobs and the dead-end lives that inevitably spring from such jobs, these people were just passing time, one prolonged meeting at a time. Just as reality television soothes a viewer\'s inner narcissist by telling stories of even more pronounced narcissists wreaking havoc on their surroundings, The Office made its audience feel better about their professional lives by showcasing a workplace with even drabber décor and more grating coworkers.</p>		\n										<img width=\"640\" height=\"961\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/about.jpg\" alt=\"\" loading=\"lazy\" />','About','','inherit','closed','closed','','9-revision-v1','','','2021-03-27 07:31:06','2021-03-27 07:31:06','',9,'http://localhost/assignment/?p=191',0,'revision','',0),(193,1,'2021-03-27 07:35:27','2021-03-27 07:35:27','<h2>ABOUT  The office</h2>\n		<p>In a mockumentary design, it shows Michael Scott (Steve Carell), regional manager of the Scranton branch office, as he attempts to persuade the movie producers of the narrative that he directs a cheerful, well-running office. Then, agent Jim Halpert (John Krasinski) discovers strategies to sabotage his solid shape mate, Dwight Schrute (Rainn Wilson); assistant Pam Beesly (Jenna Fischer) is attempting to manage Michael\'s inhumanities and flubs; and the impermanent representative Ryan Howard (B. J. Novak) is acting generally as an eyewitness of the madness around him. Considering that most of those episodes clocked in around 22 minutes apiece, that means that it would take you roughly 4,422 minutes to watch the entire series. Some of you may not have time in your busy schedules to accomplish such a demanding task (though I would argue it\'s well worth the effort). </p><p> </p><p>Set in Scranton, Pennsylvania, in the sales office of a nearly obsolete paper company, the show\'s characters at first didn\'t develop as mu