. Just as reality television soothes a viewer\'s inner narcissist by telling stories of even more pronounced narcissists wreaking havoc on their surroundings, The Office made its audience feel better about their professional lives by showcasing a workplace with even drabber décor and more grating coworkers.</p><p>Based on the award-winning British comedy of the same name, this acclaimed sitcom is told through the lenses of a documentary film crew and filled with gossip, pranks, romance and general foolishness at Dunder-Mifflin Paper Co. in Scranton, Pennsylvania. If you\'ve ever hated your boss, your job or both, then you\'ll love this show.</p>		\n										<img width=\"640\" height=\"961\" src=\"http://localhost/assignment/wp-content/uploads/2021/03/about.jpg\" alt=\"\" loading=\"lazy\" />','About','','inherit','closed','closed','','9-revision-v1','','','2021-03-27 07:35:27','2021-03-27 07:35:27','',9,'http://localhost/assignment/?p=195',0,'revision','',0),(196,1,'2021-03-27 07:51:45','2021-03-27 07:51:45','','2009DarrylCroppeed.PNG','','inherit','open','closed','','2009darrylcroppeed-png','','','2021-03-27 07:51:45','2021-03-27 07:51:45','',0,'http://localhost/assignment/wp-content/uploads/2021/03/2009DarrylCroppeed.PNG.png',0,'attachment','image/png',0),(197,1,'2021-03-27 07:51:47','2021-03-27 07:51:47','','2009Kevincropped.PNG','','inherit','open','closed','','2009kevincropped-png','','','2021-03-27 07:51:47','2021-03-27 07:51:47','',0,'http://localhost/assignment/wp-content/uploads/2021/03/2009Kevincropped.PNG.png',0,'attachment','image/png',0),(198,1,'2021-03-27 07:51:50','2021-03-27 07:51:50','','2009Meredith','','inherit','open','closed','','2009meredith','','','2021-03-27 07:51:50','2021-03-27 07:51:50','',0,'http://localhost/assignment/wp-content/uploads/2021/03/2009Meredith.jpg',0,'attachment','image/jpeg',0),(199,1,'2021-03-27 07:51:55','2021-03-27 07:51:55','','Andy Bernard','','inherit','open','closed','','andy-bernard','','','2021-03-27 07:51:55','20